import React from 'react';
import classes from '../../css/Dialogues/Dialogues.module.css';
import {NavLink} from 'react-router-dom';

const DialogueItem = (props) => {
    return (
        <div className={classes.dialogue}>
            <NavLink to={'/messages/' + props.id}>
                {props.name}
            </NavLink>
        </div>
    );
}

const Message = (props) => {
    return <div className={classes.message}>{props.message}</div>
}

const Dialogues = (props) => {

    let dialoguesData = [
        {id: 1, name: 'Мария'},
        {id: 2, name: 'Антон'},
        {id: 3, name: 'Мартин'},
        {id: 4, name: 'Алексей'},
        {id: 5, name: 'Евгения'}
    ]

    let dialoguesElements = dialoguesData
        .map(dialogue => <DialogueItem name={dialogue.name} id={dialogue.id} />);

    let messagesData = [
        {id: 1, message: 'Hi!'},
        {id: 2, message: 'How r u?'},
        {id: 3, message: 'OK. And u?'}
    ]

    let messagesElements

    return (
        <div className={classes.dialogues}>
            <div className={classes.dialogues_items}>
                <DialogueItem name={dialoguesData[0].name} id={dialoguesData[0].id} />
                <DialogueItem name={dialoguesData[1].name} id={dialoguesData[1].id} />
                <DialogueItem name={dialoguesData[2].name} id={dialoguesData[2].id} />
                <DialogueItem name={dialoguesData[3].name} id={dialoguesData[3].id} />
                <DialogueItem name={dialoguesData[4].name} id={dialoguesData[4].id} />
            </div>
            <div className={classes.messages}>
                <Message message={messagesData[0].message} />
                <Message message={messagesData[1].message} />
                <Message message={messagesData[2].message} />
            </div>
        </div>
    );
}

export default Dialogues;
